const express = require('express');
const cors = require('cors');  // Import the CORS middleware
const app = express();
const port = 3000;

// Enable CORS for all routes and all origins
app.use(cors());

// Pre-encoded HTML (replace this with your actual pre-encoded HTML content)
const preEncodedHtml = ''; // Example base64-encoded string

// Route to handle requests and send the pre-encoded HTML
app.get('/getEncodedHtml', (req, res) => {
    try {
        // Send the pre-encoded HTML as the response
        res.send(preEncodedHtml);
    } catch (error) {
        res.status(500).send('Error sending encoded HTML content');
    }
});

// Start the server
app.listen(port, () => {
    console.log(`Server running at http://localhost:${port}`);
});
